import React from 'react';
import '../App.css';
import './Mail.css';


function Mail() {
  return (
    <div className='mail-container'>
    <h2>Contact Me</h2>
      <p>Are you interested in collaborating?</p>
      <p>Please send me an email or call me.</p> 
    <i class="far fa-envelope fa-5x"></i>
    </div>
  );
}

export default Mail;
